script: |
  super -f text -I q11574.spq | sort > q11574.out

inputs:
  - name: q11574.spq
    data: |
      SELECT col0 + + col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col2 BETWEEN - 62 AND + col1 * 82 - 74 - col0;
  - name: tab2

outputs:
  - name: q11574.out
    data: |
      128
      150
      92
